// ⚠️ 성인(adult)은 기존 호환용으로 teen과 동일 풀을 사용합니다.
const GROUP_TO_AGES = {
  young: [5,6,7],
  child: [8,9,10],
  teen: [11,12,13],
  adult: [11,12,13]
};

// 각 그룹/과목당 목표 문제 수
const TARGET_PER_SUBJECT = 50;

// 내부: 그룹+과목을 평탄화해서 index 접근 가능하게 만들기
const FLAT = { math:{}, science:{}, common:{} };

// 유효성 필터(답이 '?' 인 더미 데이터 제거)
function _isValidItem(subject, item) {
  if (!item) return false;
  if (subject === 'math') {
    return typeof item.q === 'string' && item.q.trim().length > 0 && item.a !== undefined && item.a !== null && String(item.a).trim() !== '?' && String(item.a).trim() !== '';
  }
  if (subject === 'science') {
    return typeof item.q === 'string' && item.q.trim().length > 0 && (item.a === 'O' || item.a === 'X');
  }
  // common
  return typeof item.q === 'string' && item.q.trim().length > 0 && Array.isArray(item.c) && item.c.length === 4 && typeof item.a === 'number';
}

// deterministic filler (그룹/과목 고정 50개를 항상 만족)
function _makeFiller(subject, group, startIdx, count) {
  const out = [];
  for (let i = 0; i < count; i++) {
    const k = startIdx + i;
    if (subject === 'math') {
      // 간단한 산수(그룹별 범위)
      const max = (group === 'young') ? 10 : (group === 'child') ? 30 : 80;
      const a = (k * 7) % max;
      const b = (k * 11) % max;
      const q = `${a} + ${b} = ?`;
      out.push({ q, a: String(a + b), _age: null, _i: k, _f: true });
      continue;
    }
    if (subject === 'science') {
      const facts = [
        { q:'해는 동쪽에서 뜬다', a:'O' },
        { q:'물은 0도에서 얼 수 있다', a:'O' },
        { q:'달은 스스로 빛을 낸다', a:'X' },
        { q:'무지개는 보통 7가지 색이다', a:'O' },
        { q:'식물은 광합성을 한다', a:'O' },
        { q:'번개는 소리보다 먼저 보인다', a:'O' },
      ];
      const f = facts[k % facts.length];
      out.push({ q: `(OX) ${f.q}`, a: f.a, _age: null, _i: k, _f: true });
      continue;
    }
    // common (4지선다)
    const commons = [
      { q:'한국의 수도는?', c:['서울','부산','대구','인천'], a:0 },
      { q:'1년은 몇 달?', c:['12달','10달','11달','13달'], a:0 },
      { q:'가장 큰 대륙은?', c:['아시아','유럽','아프리카','오세아니아'], a:0 },
      { q:'바다에 사는 동물은?', c:['고래','호랑이','독수리','강아지'], a:0 },
    ];
    const f = commons[k % commons.length];
    out.push({ q: f.q, c: f.c, a: f.a, _age: null, _i: k, _f: true });
  }
  return out;
}

